class Solution(object):
    def findBall(self, grid):
        """
        :type grid: List[List[int]]
        :rtype: List[int]
        """
        z = 0
        res = []
        while z < len(grid[0]):
            y = 0
            x = z
            while y < len(grid):
                if grid[y][x] == 1:
                    if x + 1 < len(grid[0]) and grid[y][x+1] == 1:
                        x += 1
                    else:
                        res.append(-1)
                        break
                else:
                    if x - 1 > -1 and grid[y][x-1] == -1:
                        x -= 1
                    else:
                        res.append(-1)
                        break
                y += 1
            else:
                if y == len(grid) and -1 < x < len(grid[0]):
                    res.append(x)
                else:
                    res.append(-1)
            z += 1
        return res


